import "./landingPage.css"
import React, {useState} from 'react';

function LandingPage() {
    const [isSignUp, setIsSignUp] = useState(true)

    return (<>
        <div className="header">Thoth</div>
        <div className="landingPageGrid">
            <div className="landingPageForm">
                <h2>{isSignUp ? "Sign Up" : "Log In"}</h2>
                <form onSubmit={ProcessSubmit(isSignUp)}>
                    <input type="text" placeholder="Username" required />
                    <input type="password" placeholder="Password" required />
                    {isSignUp && <input type="email" placeholder="Email Address" required />}
                    <button type ="submit">{isSignUp ? "Sign Up" : "Log In"} </button>
                </form>
                <button className="toggle-btn" onClick={() => setIsSignUp(!isSignUp)}>
                    {isSignUp ? "Already have an account? Log In" : "Don't have an account? Sign Up"}
                </button>
            </div>
            <div className="landingPageSlideShow"></div>
        </div>

    </>);
}

function ProcessSubmit(isSignUp) {
    return;
}

export default LandingPage;
